import styled from "styled-components";

/* export const Style = styled.Div {
	width: '85%',
	height: '70%',
    'borderRadius': '20px',
    'boxShadow':' 6px 5px 15px 5px rgb(0 0 0 / 50%) ',


} */


export const Style = styled.div `
	{	
		width: 85%;
		height: 70%;
		borderRadius: 20px,
		boxShadow: 6px 5px 15px 5px rgb(0 0 0 / 50%) ,
	}
`;


export const BtnStyle = styled.div `
 	.crime-marker{
	background-color: transparent;
	border: none;
	width:50%
	height:50%
	}


`;
